INSERT INTO `properties` (`id`, `countryId`, `stateId`, `cityId`, `neighborhoodId`, `zipcode`, `latitude`, `longitude`, `date`, `description`, `bathrooms`, `floor`, `rooms`, `surface`, `price`) VALUES
(135472387, 724, 7, 7020, 0, 7190, 39.65522, 2.630216, '2021-11-17', 'Excepcional chalet unifamiliar en una zona residencial de Esporlas, rodeada de bosque y vistas a la Tramuntana.\r\n\r\nCon una superficie de 250 m2 esta propiedad esta distribuída en dos plantas. Cuenta con recibidor, salón comedor y sala de estar, con chimenea, ambas con salida a porche de 30 m2 con escaleras que conducen a la piscina (10 x 5) y solarium.\r\nEn esta zona cuenta con un área de chillout, con barbacoa y cenador. Un vestuario o aseo con ducha para invitados.\r\n\r\nLa cocina amplia, está amueblada y equipada y se completa con una despensa. Además en este sector hay una habitación de servicio.\r\n\r\nSeis dormitorios dobles y una sala de estar con terraza propia en planta alta, todos ellos con armarios empotrados y con vistas al jardín. \r\nTres baños en total, dos de ellos en suite y aseo con ducha en piscina.\r\n\r\nUn garage cubierto con mando a distancia y para dos coches.\r\n\r\nVarias terrazas y jardín que rodean la propiedad, hacen las delicias de este chalet y su entorno.\r\n\r\nUn amplio trastero/bodega de unos 95 m2 aproximadamente en planta sótano, muy aireado.\r\nCuenta con sistema de calefacción por gasoil y aire acondicionado f/c.\r\n\r\nPRECIO ALGO NEGOCIABLE !\r\n\r\n*** PALMACASA INMOBILIARIA ***.', 4, 0, 6, 250, 595000),
(139498071, 724, 7, 7051, 0, 7530, 39.60649, 3.279767, '2021-11-17', 'Casa en solar de aprox. 440m2, vivienda de 228m2 construidos, amplio salon comedor con chimenea, cocina amueblada y equipada con office, coladuria, 4 dormitorios dobles, 2 baños, calefacción, vigas vistas,  suelos de gres, porches, jardin de aprox 50m2, 2 plazas de garaje, terrazas de aprox 150m2.', 2, 0, 4, 228, 630000),
(140250980, 724, 7, 7011, 3756, 7180, 39.5023, 2.469131, '2021-11-17', 'Chalet unifamiliar con carácter y apartamento de invitados, En solar de 1.000 m2 aprox., 270m2 aprox., salón comedor con chimenea y altillo de 40m2, amplia cocina amueblada/equipada con office, 3 dormitorios dobles, 2 baños (1 en suite), climalit,varias terrazas, apartamento de invitados con entrada independiente con cocina salón y dormitorio, construido con técnica Bio-construcción, madera iroko, bodega, piscina, jardín tropical y zona chill out.', 2, 0, 3, 270, 1500000),
(142852329, 724, 7, 7055, 0, 7458, 39.70525, 3.102462, '2021-11-17', 'Casa en Santa Margalida, 200 m. de superficie, 30 m2 de terraza, 4 habitaciones dobles, 2 baños, propiedad de origen, cocina equipada, suelo de gres, carpintería exterior de madera. Extras: chimenea, jardín , luminoso, mirador, muebles, patio, terraza, garaje  incluido, parking incluido Para mas información o visita sin compromiso no dude en contactar con nosotros o llamarnos   Venta: 147000 €  House in Santa Margalida, 200 m. Surface, 30 m2 terrace, 4 bedrooms, 2 baths, home ownership, equipped kitchen, ceramic floor, exterior carpentry. Extras: fireplace, garden, bright, gazebo, furniture, patio, terrace, garage included, parking included For more information or visit without commitment do not hesitate to contact us or call    Sale: 147000 €  Haus in Santa Margalida, 200 m. Fläche, 30 m2 Terrasse, 4 Schlafzimmer, 2 Badezimmer, Hausbesitz , voll ausgestattete Küche, Fliesenboden , Aussenholz . Extras: Kamin, Garten, hell, Pavillon, Möbel, Terrasse, Terrasse, Garage, einem Parkplatz inbegriffen Für weitere Informationen oder Besuch ohne Verpflichtung, zögern Sie nicht, uns oder rufen Sie zu kontaktieren    Verkauf: 147000 €', 2, 6, 4, 200, 147000),
(143171836, 724, 7, 7040, 1021, 7014, 39.56204, 2.629589, '2021-11-17', 'Ático en Paseo Marítimo con vistas al mar, 175m2 aprox., salón de 40,29m2 aprox., cocina amueblada y equipada, coladuría, 4 dormitorios (posibilidad de 5), 2 baños, 1 en suite, suelos de parquet, climalit, calefacción, aire acondicionado frio/calor, terraza solarium de 109m2 aprox. con sala 21m2 aprox, piscina comunitaria, 1 plaza de garaje, vistas al mar.', 2, 0, 4, 175, 750000),
(143532209, 724, 7, 7010, 0, 7110, 39.69775, 2.697803, '2021-11-12', 'Finca en la Tramuntana en solar de 108.000 m2 aprox. con coto privado de caza, La finca consta de varias edificaciones típicas mallorquinas con un total de 350m2 constr. aprox.\r\nCasa Principal con porche: 140m2 construidos aprox., amplio salón comedor con zona de chimenea, vigas vistas, cocina rústica de madera, 2 habitaciones dobles, 1 baño completo, cuarto de caza.\r\nAnexo invitados: 60m2 aprox., domitorio doble con baño en suite, en planta baja una habitación para salón-comedor.\r\nPiscina con solarium, cocina de verano con barbacoa, otras dependencias, agua de pozo, cisterna, vistas panorámicas increibles. Paradisíaco.', 3, 0, 3, 200, 1990000),
(144770160, 724, 7, 7020, 0, 7190, 39.66808, 2.578035, '2021-11-17', 'Chalet unifamiliar en solar de 4.000 m2 aprox. 496 m2, dos salones de 67 m2y 36 m3, amplia cocina amueblada y equipada de 40 m2, 4 dormitorios dobles, 4 baños (1 en suite), armarios, calefacción, aire acondicionado, garaje para 2 coches, parking, trastero, piscina, vistas despejadas.', 4, 0, 4, 496, 1625000),
(145009524, 724, 7, 7039, 0, 7440, 39.73587, 3.058458, '2021-11-02', 'Típica casa de Pueblo muy céntrica en Muro. Se tiene que reformar en su totalidad. Posibilidad de edificar una o dos plantas. La vivienda tiene acceso por 3 calles. Posibilidad de garaje. Cisterna. Chimenea. Muy luminosa. Cerca de la Plaza de Muro. Calle peatonal. Cerca de bares, restaurantes, Iglesia.', 2, 0, 6, 380, 165000),
(145241597, 724, 7, 7033, 2679, 7500, 39.56941, 3.20733, '2021-11-17', 'En&nbsp;la zona&nbsp;centro de la localidad, Amplio y luminoso Piso con Terraza privada en perfecto estado de conservaci&oacute;n, situado en segunda planta de edificio sin ascensor. Vivienda de 80 m2 compuesta de Entrada, 2 Distribuidores, Gran Sal&oacute;n Comedor con salida a Terraza privada de 30 m2, Cocina abierta amueblada y equipada, 1 Dormitorio doble, 1 Dormitorio individual, 1 Ba&ntilde;o (Wc, Ba&ntilde;era) Pre- Instalaci&oacute;n de aire acondicionado en toda la vivienda. Calefacci&oacute;n el&eacute;ctrica de bajo consumo en Sal&oacute;n Comedor y Ba&ntilde;o. Plaza de aparcamiento n&uacute;m. 3 opcional. Precio: 18.000 €. Gastos comunitarios: 25 Euros/mes', 1, 6, 2, 110, 120000),
(147191028, 724, 7, 7011, 3760, 7181, 39.48154, 2.529205, '2021-11-17', 'A Estrenar. Chalet unifamiliar de lujo en solar de 1.412m2 aprox. 440,87m2 aprox., salón comedor con doble altura, amplia cocina amueblada y equipada de diseño con electrodomésticos de primeras marcas, 5 dormitorios dobles, 5 baños, 3 en suite, suelos de piedra caliza, suelo radiante, bombra frio/calor, 286m2 aprox de terrazas y pergolas, jacuzzi en terraza superior, chimenea exterior, 89m2 aprox de porches, piscina, jardin diseñado por un paisajista. Acabados de lujo. ', 5, 0, 5, 440, 3300000),
(147373924, 724, 7, 7033, 2676, 7500, 39.51813, 3.298147, '2021-11-17', 'Fantástica Finca Rústica de 7.630 m2 con Casa de estilo mallorquín, situada en la zona de Es Caparó a 2 Km de distancia de la localidad de Manacor. Vivienda de 120 m2 con Gran Salón Comedor con chimenea, Cocina independiente completamente amueblada, 4 Dormitorios dobles, 1 Baño, Garaje. Amplias Terrazas. Piscina (8 m x 4 m) Terreno llano de forma rectangular completamente vallado con huerta y árboles frutales. Contador de Gesa. Pozo de agua privado. Fácil acceso por vía de servicio desde carretera principal. Vistas a las montañas.', 1, 0, 4, 200, 395000),
(148117267, 724, 7, 7040, 1021, 7014, 39.56978, 2.630367, '2021-11-17', 'A estrenar. Duplex en Son Armadams con vistas al mar, Salon comedor, cocina amueblada equipada, 2 habitaciones dobles, 1 baño, aseo, climalit, aire acondicionadio, solarium de 11m2 aprox., 1 plaza de garaje y trastero opcional, piscina comunitaria.', 2, 0, 2, 80, 449000),
(148797089, 724, 7, 7033, 2679, 7680, 39.56131, 3.314552, '2021-11-17', 'Espectacular Casa Rústica de estilo típico mallorquín con fantásticas vistas al mar y a las montañas, situada en el Camí de Sa Gruta a 3 km de distancia de la localidad de Porto Cristo. Vivienda en Planta Baja de 128 m2 compuesta de Recibidor, Sala de Estar con estufa de leña, Gran Cocina Comedor completamente amueblada y equipada provista de Chimenea, 2 Dormitorios dobles, 2 Baños (Wc, Ducha) 2 Vestidores, Altillo de 45 m2 compuesto de 2 Dormitorios dobles, 1 Baño (Wc, Ducha). Garaje de 90 m2 con opción de cambio de uso y Baño (Wc, Ducha). Terrazas exteriores de 166 m2. Piscina Privada de 32 m2 de lámina de agua (8 m x 4 m) Porche de 36 m2 (9 m x 4 m) Terreno llano de 18.644 m2 de forma rectangular completamente vallado de pared de piedra y rejilla con árboles autóctonos y frutales. Puerta de entrada automática. Contador de electricidad. Pozo de agua. Depósito de agua. Posibilidad de ampliar las edificaciones existentes conforme la normativa urbanística municipal. Fácil acceso por camino asfaltado. Antigüedad: 2.018', 4, 0, 4, 429, 750000),
(149660424, 724, 7, 7045, 0, 7194, 39.62905, 2.530827, '2021-11-13', 'Vivienda unifamiliar independiente con salón-comedor, 4 dormitorios, 3 baños, cocina independiente amueblada, terraza descubierta, sala polivalente. Garaje. Porches exteriores cubiertos, piscina, barbacoa de obra, pozo. Zona residencial.  Algunos de los inmuebles comercializados a travÃ©s de ABANCA INMOBILIARIA tienen instaladas diversas medidas de seguridad, tales como alarmas, puertas de seguridad, etcâ?¦, que no forman parte de la oferta de venta y por lo tanto, no serÃ¡n objeto de transmisiÃ³n junto con el inmueble, procediÃ©ndose a su retirada, de forma previa a la formalizaciÃ³n de la escritura de compraventa.', 3, 0, 4, 369, 737000),
(149682282, 724, 7, 7040, 1024, 7008, 39.58236, 2.666068, '2021-11-17', 'Se vende 1º piso con parking y terraza en Palma de Mallorca, zona Aragon,  de 108 m2. de superficie construida, distribuidos en gran salon comedor, cocina amueblada y equipada con lavadora, microondas empotrado, nevera, coladuria, 20 m2 de terraza en planta, 3 habitaciones dobles y un vestidor (la principal con baño en suite) y salida a la terraza, 2 baños, propiedad en buen estado, suelo de parquet, carpintería exterior de pvc / climalit con persianas enrollables, Totalmente reformado en 2018, Aacc frio calor por conducto, electrodomésticos, equipado, gas ciudad, totalmente amueblado.\r\n Gastos de comunidad: 70 Eur al mes con agua incluida, la finca cuenta con dos ascensores. Certificado energetico: E.\r\n ', 2, 0, 3, 108, 360000),
(149732246, 724, 7, 7055, 0, 7458, 39.76159, 3.160905, '2021-11-17', 'Planta baja en Can Picafort zona Can picafort, 90.00 m. de superficie, 120.00 m2 de terraza, 150 m. de la playa, 3 habitaciones dobles, 2 baños,  un aseo, propiedad para entrar a vivir, cocina equipada, carpinteria interior de madera, orientación sur, gres, carpintería exterior de aluminio / climalit.  Extras: agua, aire acondicionado, bomba frío y calor, buhardilla, calefacción, despensa, esquina, jacuzzi, jardín, lavandería, luminoso, luz, mirador, muebles, patio, pérgola, terraza, trastero, autobuses, árboles, céntrico, colegios, costa, supermercados, vallado, vistas despejadas, garaje  incluido  Gastos de comunidad: 33 Eur.    Venta: 264.000 €', 3, 0, 3, 90, 264000),
(150061725, 724, 7, 7040, 1023, 7010, 39.59193, 2.648, '2021-11-14', 'Primer piso situado en carretera Valldemossa, consta de amplio recibidor que da paso a una sala de estar-comedor de 21,05 m² con balcón de 3,85 m². \n\nLa vivienda se distribuye en 3 habitaciones, dos habitaciones dobles de 10,32 m² y 12,24 m² esta última con baño en suite y una individual, Otro baño de invitados de 4,76 m² La cocina de 9,77 m² está equipada con muebles, campana extractora, placa de inducción y horno. \n\nCada vivienda incluye un parking y un trastero.\n', 2, 6, 3, 99, 299000),
(150061756, 724, 7, 7040, 1023, 7010, 39.59193, 2.648, '2021-11-15', 'Ático de 73 m² situado en calle Bolero amueblado. La cocina abierta al salón genera una sensación de gran amplitud, equipada con muebles, campana extractora, placa de inducción y horno. Amplia terraza de 37 m². \n\nLa vivienda consta de dos habitaciones, una doble de 10,59 m² y una individual de 8,49 m² ambas con armarios empotrados completamente equipados. Baño con bañera, un inodoro, mueble de baño con lavabo y un secador de toallas. \n\nCada vivienda incluye un parking y un trastero.\n', 1, 0, 2, 73, 324000),
(150278342, 724, 7, 7033, 2679, 7500, 39.56306, 3.204417, '2021-11-17', 'En la Ronda de Felanitx de Manacor, Excelente Apartamento del año 2.009 con buenas calidades situado en primera planta de edificio con ascensor en zona muy bien comunicada con toda clase de servicios cercanos. Vivienda de 42 m2 con Salón Comedor, Cocina abierta  completamente amueblada y equipada, 1 Dormitorio doble, 1 Baño/Lavandería. Instalación de aire acondicionado con bomba de calor. Muy luminoso y espacioso. Zona de fácil aparcamiento.', 1, 6, 1, 45, 115000),
(150571761, 724, 7, 7033, 2681, 7687, 39.56173, 3.37564, '2021-11-17', 'Lujosa casa de campo de obra nueva de aprox. 363m² situada en la zona privilegiada de Cala Morlanda, a solo 600 metros del mar. Construida con materiales de primera calidad. Ofrece planta baja y primer piso. Planta baja con 2 dormitorios con baño en suite, aseo para invitados, amplio salón-comedor, cocina (amueblado y equipado al gusto del comprador) y lavandería. Del salón se sale a la terraza con acceso a la piscina. En la primera planta se encuentra un gran dormitorio con baño en suite y salida a la terraza de la cual se puede apreciar unas vistas despejadas del campo. Pre-inst. de aire acondicionado y chimenea.', 4, 0, 3, 363, 1390000),
(150602417, 724, 7, 7059, 0, 7638, 39.31913, 2.997309, '2021-11-17', 'Si lo que buscas es veranear en un entorno de naturaleza y playas vírgenes este piso es sin duda la mejor inversión que puedas realizar. \r\n\r\nSituado en la  Colonia de Sant Jordi  (Ses Salines), consta de 81 m2 de superficie construida,  15 m2 de terraza en planta y otra de 15m2  de solárium en la planta superior, con vistas al mar a lo lejos donde se puede ver la Isla de Cabrera, a tan solo 300 m. de la playa, es un 2º piso y consta de salón comedor con cocina reformada abierta, 2 habitaciones dobles con armarios empotrados,  un baño completo, parking y trastero.\r\n\r\nCalidades: aire acondicionado,  propiedad seminueva en perfecto estado, portero automático, finca de pocos vecinos,  carpintería exterior de aluminio / climalit.\r\n\r\nLa finca es sin duda la mas bonita de toda la calle, cuenta con una farmacia al lado, supermercado, panadería, banco, para de autobús, todo a cien, ferretería, restaurantes, colmado, y está a tan solo 300 m. de la playa y del paseo. Lo mejor de todo es que se puede ir a pie a la playa más emblemática de la isla, que es es Trenc, es Dolç, etc. Ideal para veranear en  familia en un entorno natural y tranquilo. Visite visita sin compromiso antes de que se venda!!\r\n ', 1, 7, 2, 81, 229000),
(151157281, 724, 7, 7062, 0, 7559, 39.6268, 3.396026, '2021-11-16', 'Casa situada en el Port Nou en primera línea del mar, un sitio idílico y muy privilegiado de la costa Mallorquina, la casa ofrece aprox. 360m² y está construida en un solar de 200 m².La casa está dividida en tres plantas. En la planta baja hay un comedor, cocina, un salón y baño, con un pequeño patio trasero y una terracita delante a solo 20 metros del mar. Cochera convertible en una habitación o cualquier otro uso. En el primer piso hay un distribuidor con 5 dormitorios y la segunda planta una gran sala de aprox. 30m² con vistas esplendidas del mar apto para estudio, dormitorio principal, oficina etc. Tiene tres metros de playa delante con un espigón para poder amarrar una pequeña embarcación. Necesita renovación completa', 2, 0, 5, 360, 800000),
(151556102, 724, 7, 7040, 1023, 7004, 39.58815, 2.65934, '2019-06-10', 'OBRA INICIADA. Residencial INBISA Arxiduc: 62 confortables viviendas de 2, 3 y 4 dormitorios, distribuidas en un edificio de cuatro plantas de altura y con locales comerciales en los bajos. La arquitectura del complejo residencial dispone de un diseño cuidado y vanguardista, integrado perfectamente con el paisaje que le rodea y unos acabados de alta calidad en todas las estancias de las viviendas, zonas comunes y edificios.\nAdemás podrás disfrutar de atractivas y cuidadas zonas comunes de uso exclusivo: garajes, trasteros, piscina y zona de juegos infantiles.\nPara más información:  *** \n', 2, 6, 2, 78, 259500),
(151805275, 724, 7, 7051, 0, 7560, 39.58461, 3.378031, '2021-11-17', 'Apartamento en tercera planta de obra nueva situado en la zona residencial de Sa Coma, a 10 min. de la playas de Sa Coma y Cala Millor y del parque natural Punta de N\'Amer. El apartamento de aprox. 82m² mas aprox. 9m² terraza ofrece 2 dormitorios, 2 baños, salón-comedor, cocina y lavandería. Equipado con calefacción por suelo radiante y aire acondicionado centralizado. Modernos acabados de primeras calidades. Incluye una plaza en garaje subterráneo y trastero. El complejo ofrece 2 piscinas (1 infantil) y jardín comunitario. Edificio con ascensor. Entrega de llaves aprox. Julio 2020.', 2, 0, 2, 82, 290000),
(151966104, 724, 7, 7001, 0, 7340, 39.70496, 2.792926, '2021-11-17', 'Alaró. Finca rústica en solar de 40.000 m2 aprox. Vivienda en 500m2 aprox. constr., 500 m2 construidos, con patio central (estilo romano), varios salones con chimenea, libreria, amplia cocina con office,  6 dormitorios dobles, 6 baños, climalit, madera iroko, calefacción, a.a frío/calor, piscina, pista de tenis, casa de madera: 3 habitaciones, cocina, baño. Barbacoa, terrazas, porches, jardín, plaza de garaje. Muy independiente.', 6, 0, 6, 500, 2600000),
(152093186, 724, 7, 7036, 2861, 7141, 39.62094, 2.745742, '2021-11-17', 'Finca rústica en solar de 15.000m2 aprox con piscina, 490m2 aprox, 45m2 aprox de salón (2 salones), cocina, 5 dormitorios dobles, 4 baños, a.a. frío/ calor, 4 plazas de garaje piscina privada con solarium. Finca rústica con mucho carácter', 4, 0, 5, 490, 1595000),
(152231684, 724, 7, 7040, 1021, 7011, 39.5896, 2.615928, '2021-08-17', 'En la llamada zona colegios, se encuentra este amplio dúplex (2º SIN ascensor), perfecto para familias con hijos en edad escolar.    Luminosa vivienda dividida en dos plantas en un edificio de ...... alturas.    Consta de 4 habitaciones dobles exteriores; 2 baños completos; cocina completamente amueblada y equipada con acceso a la galería independiente; salón comedor con grandes ventanales.    Cerramientos de madera.    Fantástico emplazamiento, rodeado de los mejroes colegios, parques infantiles, zonas deportivas y a tan solo 10 minutos del centro de la ciudad; buen transporte público.', 2, 7, 4, 120, 252000),
(152235771, 724, 7, 7040, 1024, 7008, 39.57959, 2.664354, '2019-08-01', '¡Últimos pisos disponibles! Aragó es una promoción de 12 viviendas situada en la calle Aragó, 94-96 de Palma, muy cercana al centro y muy bien conectada con las principales vías de comunicación, como la Via de Cintura. La promoción está a un paso de todo tipo de servicios, equipamientos (como el colegio Santa Mónica o la Escuela Oficial de Idiomas) y transportes públicos (con varias paradas de bus cerca y el metro a pocos minutos a pie). También se encuentra a apenas 1 km de El Corte Inglés de Avenidas y de la Plaza de España.\n\n\nSe trata de pisos de 2 y 3 dormitorios, con 1 o 2 baños por vivienda y con superficies que van desde los 61 hasta los 102 m². Con unas distribuciones amplias y perfectamente estudiadas, la mayoría de los pisos de Magnòlia-Aragó cuentan con cocinas abiertas o semiabiertas. Esto permite una mayor integración de espacios, creando amplitud y un aprovechamiento óptimo de la zona de día de la vivienda.\n\nEn cuanto a los espacios exteriores de esta promoción, cabe destacar las terrazas de hasta 21 m² y los soláriums de los áticos, con superficies de hasta 34 m². Todos los pisos tienen lavadero, bien totalmente independiente o conectado con la cocina.\n\nMagnòlia-Aragó cuenta con acabados de gran calidad: pavimento de gres en cocina y baño y parqué en el resto de la vivienda; horno y vitrocerámica de marcas de primer nivel; calefacción, aire acondicionado… ¡y mucho más!\n\nLas 12 viviendas se distribuyen en una planta baja y cinco alturas y se complementan con un sótano en el que hay 12 trasteros. Además, disponemos de plazas de aparcamiento en la promoción de Magnòlia, situada a apenas 2 minutos a pie.', 2, 9, 3, 85, 240000),
(152263708, 724, 7, 7040, 1023, 7004, 39.59002, 2.65832, '2021-11-12', 'Desde Aedas Homes te ofrecemos una promoción de 104 viviendas para todas las necesidades, de 2 a 4 dormitorios, con plaza de garaje y trastero, que satisface todas tus necesidades en la ciudad de Palma de Mallorca. Además, la urbanización también dispone de una zona de juegos para niños y un espacio ajardinado para disfrutar con los que mas quieres.Para que aproveches el espacio al máximo, tu salón se abre a la terraza dotándolo de mayor amplitud. *** Para pasar una divertida tarde en familia o con amigos, Vasco de Gama cuenta con una piscina en la 5ª planta que hará las delicias de grandes y pequeños. Date un refrescante chapuzón al llegar a casa y olvídate del estrés y la rutina. Todas las viviendas de la promoción incluyen plaza de garaje y trastero incluido en el precio y con la posibilidad de adquirir una segunda plaza de aparcamiento para que la comodidad sea máxima. Además, las viviendas de 4 dormitorios y los áticos cuentan con dos plazas de garaje.', 2, 8, 2, 104, 286000),
(152415340, 724, 7, 7011, 3756, 7180, 39.50208, 2.471349, '2021-11-17', 'Piso en complejo residencial en zona Santa Ponsa, 146m2 aprox., salón comedor, cocina amueblada y equipada, 3 dormitorios dobles con armarios, 3 baños (2 en suite), aseo, a.a frío/calor, suelos mármol, terrazas, plaza de garaje, trastero, piscina comunitaria, vistas despejadas. Amueblado.', 4, 0, 3, 146, 990000),
(152535568, 724, 7, 7036, 2856, 7141, 39.62806, 2.702196, '2021-11-17', 'En la entrada de Es Garrovers encontramos esta preciosa finca con jardines impresionantes que invitan a entrar y quedarte. En una de las parcelas más grandes de la zona (2.800m2), con fácil acceso y perfectamente cercada, encontramos arboles enormes con una tranquilidad especial, piscina con solarium y varias construcciones alrededor de la casa principal como zona de barbacoa, un pequeño lago, porches y pista de tenis. La casa principal se divide en 2 plantas con más de 300m2 construidos con varias terrazas y un amplio garaje.', 4, 0, 4, 600, 750000),
(152823041, 724, 7, 7011, 3766, 7181, 39.53784, 2.57769, '2021-11-17', '20 exclusivas viviendas dentro de un exquisito complejo en la zona de Cala Vinyes. Mourelle - Calvià es el último proyecto de obra nueva que AEDAS Homes ofrece en la costa suroeste de Mallorca, dispone de viviendas de diferente tipología; 6 villas y 14 dúplex; con 3 dormitorios y en su gran mayoría vista al mar. La promoción cuenta con piscina comunitaria; aunque también se da la oportunidad para que cada propietario tenga a su vez una piscina privada en caso así lo desee, lo que permite disfrutar de un relajante baño con vistas al Mediterráneo. Todas las viviendas están abiertas a amplias terrazas y jardines. Este espacio al aire libre, es perfecto mientras se disfruta de un relajante un baño con vistas, muy probablemente será uno de sus rincones favoritos.En AEDAS Homes nos tomamos muy en serio el cuidado del medio ambiente y, por eso, Mourelle-Calvià estará avalada por el prestigioso sello BREEAM. \r\nAhora también puedes solicitar información en  la nueva oficina de ventas  en el Centro Comercial  ABC  Serrano en Paseo de la Castellana ,  36 , Madrid.\r\n', 2, 0, 3, 286, 1420000),
