(153134197, 724, 7, 7006, 0, 7579, 39.73954, 3.284849, '2021-06-20', 'Piso en zona tranquila con vistas al mar y la montaña. El piso tiene unos 90 m2 + una gran terraza de 60 m2. Dispone de 2 habitaciones dobles grandes, 1 baño grande, comedor, cocina amplia y lavandería. Tiene plaza de parking+trastero de 11 m2, AACC en las habitaciones y salón y un termo eléctrico de 100 L. Gastos de comunidad 400€ anuales.', 1, 0, 2, 90, 247000),
