 2, 7, 3, 110, 199000),
(153220817, 724, 7, 7057, 0, 7660, 39.3753, 3.232184, '2021-11-17', '¡ Junto a la playa ! Piso de 44 m² distribuidos en salón-comedor, terraza, cocina, una habitación y un cuarto de baño. Excelente ubicación a pocos minutos de la playa Cala Gran. Posee suelos de gres, ventanas de madera, armarios empotrados... Precisa reforma, pero ofrece muchas posibilidades. Es una 3ª planta en un bloque sin ascensor. Está muy bien comunicado por transporte público y carretera. A 1 minuto de la parada de autobús y muy próximo a la costa. Hay todo tipo de servicios en la zona como colegios, tiendas, supermercados, zonas verdes, centros de salud...', 1, 8, 1, 44, 62500),
(153344334, 724, 7, 7033, 2679, 7500, 39.56859, 3.212098, '2021-11-17', 'Este edificio céntrico, cerca de la plaza Sa Bassa, consta de 3 viviendas separadas. También es posible comprar además un local comercial en la planta baja.\r\n\r\nLos apartamentos son muy luminosos debido a los grandes ventanales. Los techos altos y los típicos azulejos antiguos mallorquines dan a los apartamentos su carácter único. ¡No solo la situación privilegiada convence en este objeto de inversión!\r\n más información en www.blaumallorca.com Tel. (+34) 659075326', 3, 0, 9, 330, 235000),
(153351925, 724, 7, 7011, 3762, 7181, 39.52621, 2.538427, '2021-11-17', 'Increíble chalet de 4 dormitorios, piscina propia y amplio aparcamiento para 4 vehículos con licencia de aquiler vacacional.\r\n\r\n350 metros construidos en una parcela de 1100 metros. Cuenta con más de 200 metros de terraza y piscina de agua salada.\r\n\r\nContiene un total de 4 dormitorios dobles, uno de ellos una suite con baño propio, gran cocina equipada, amplio salón comedor, 3 baños en total y suelos de mármol.\r\nSe puede pasear por la terraza completamente alrededor del Chalet. La terraza interior puede ser utilizada como zona de confort para comer o relajarse bajo el sol con vistas privilegiadas y la terraza trasera está equipada con barbacoa. \r\nA un par de minutos de las playas más bonitas de Mallorca (A 1 km del mar, Platja de na Nadala.)\r\nTodo el chalet es un lugar fantástico para vivir o recibir a los huéspedes ya que está en posesión de una licencia de alquiler vacacional con capacidad para 8 personas, lo que lo convierte en una excelente oportunidad de inversión.\r\n\r\nMás ofertas de inmuebles en Mallorca en puroagents.com \r\n#ref:MT-002', 3, 0, 4, 350, 1690000),
(153360724, 724, 7, 7040, 1021, 7014, 39.57062, 2.63231, '2021-11-15', '\"40 viviendas exclusivas a un paso del puerto de Palma de Mallorca. Doria 6 es el proyecto de obra nueva que AEDAS Homes ofrece entre los barrios de Son Espanyolet y Santa Catalina, con viviendas de 1, 2, 3 dormitorios y espectaculares áticos.\nLa promoción cuenta con piscina comunitaria ubicada en la azotea, lo que permite disfrutar de un relajante baño con vistas al Mediterráneo y al Real Club Náutico de Palma –uno de los mejores de Europa y de referencia de regatas internacionales–.\nLos áticos de Doria 6, con 2 y 3 dormitorios, disponen de amplias terrazas en las que se proyecta una piscina propia. Este espacio al aire libre, perfecto para disfrutar mientras te das un baño en tu ‘plunge pool’, será uno de tus favoritos.\nEn AEDAS Homes nos tomamos muy en serio el cuidado del medio ambiente y, por eso, Doria 6 estará avalada por el prestigioso sello BREEAM. Con este certificado de construcción sostenible a nivel internacional se autentica la sostenibilidad del edificio desde su puesta en marcha y hasta la entrega de llaves.\"\nAhora también puedes solicitar información en  la nueva oficina de ventas  en el Centro Comercial  ABC  Serrano en Paseo de la Castellana ,  36 , Madrid.', 2, 6, 3, 116, 671000),
(153655316, 724, 7, 7011, 3762, 7181, 39.52434, 2.542286, '2021-11-12', 'Piso reformado con vistas panorámicas al mar y terraza en planta de 55 m2 aprox., 110 m2 aprox., amplio salón comedor con grandes ventanales, cocina abierta amueblada y equipada, 2 dormitorios dobles, armarios, 2 baños, a.a frío/calor, climalit, suelos gres, terraza en planta de 55 m2 aprox., bajada directa al mar, jardines y solarium al lado del mar comunitarios, plaza de garaje opcional.', 0, 0, 0, 110, 595000),
(153716981, 724, 7, 7040, 1021, 7014, 39.56828, 2.629061, '2021-11-13', 'A Estrenar. Atico con terraza solarium en zona Son Armadams con piscina comunitaria, 146,60m2 aprox., amplio salón comedor con cocina abierta al salón amueblada y equipada, 3 habitaciones dobles, armarios, 3 baños (2 en suite), suelos de gres porcelánico, suelo radiante, aire acondicionado frío/calor, solarium de 51,90m2 aprox., terraza de 12,40m2 aprox., plaza de garaje y trastero opcional, piscina comunitaria, vistas al mar desde el solarium. Fecha de entrega Otoño/Invierno 2020.', 3, 0, 3, 147, 1290000),
(153767410, 724, 7, 7045, 0, 7194, 39.62773, 2.527709, '2021-11-14', 'Casa con vistas panorámicas al mar en solar de 200m2 aprox. en tres plantas. Planta principal: salón comedor con chimenea y terraza acristalada de aprox. 30m2, cocina con salida a terraza, 1 habitación, 1 baño completo y coladuía. Planta -1: loft de 45m2 aprox. con aseo y salida a terraza de 20m2 aprox.. Planta II: apartamento anexo con entrada separada de 1 habitación, 1 baño, cocina y salón. Salida a jardín de 100m2 aprox. y garaje para un coche.', 3, 0, 3, 200, 800000),
(153771228, 724, 7, 7040, 1024, 7008, 39.58459, 2.68132, '2019-12-05', '¡Este noviembre no todo es black! Reserva tu piso del 1 al 30 de noviembre y podrás conseguir una asesoría de interiorismo.\n¡1.000 euros de descuento!\nOferta aplicable sobre el precio de venta en las cinco primeras reservas de plazas de parking de la promoción Baladre, 60 realizadas hasta el 30/10/21\n\nPromoción de 27 viviendas de obra nueva situada delante del Seminario Diocesano de Palma. Esta ubicación permite disfrutar de una importante zona verde y una buena comunicación con el resto de la ciudad.\n\n \n\nLos pisos de Baladre, 60 tienen entre 1 y 4 dormitorios. Además, cuentan con grandes terrazas que permiten la entrada de luz natural. En este sentido, cabe destacar especialmente las terrazas de los áticos.\n\n \n\nLa promoción Baladre, 60 se completa con una zona comunitaria, parkings y trasteros.', 2, 3, 4, 95, 296000),
(153851109, 724, 7, 7043, 0, 7260, 39.52422, 3.026866, '2021-11-17', 'Excepcional finca moderna con espectaculares vistas a Porreres.\r\n \r\n Esta finca se encuentra en un enclave privilegiado de Porreres, en una posición elevada panorámica a poca distancia de Porreres, rodeada de viñedos. Se reformó en el 2018, por lo que podrás disfrutar de una casa moderna con todas las comodidades. \r\n La casa consta de dos plantas, con una superficie de unos 220m². En la planta baja encontramos un amplio salón-comedor con chimenea, cocina americana, aseo de invitados con ducha y una coladuría. En la primera planta encontramos dos habitaciones dobles con baño en suite, y un gran vestidor.  No se pueden perder el precioso porche que encontramos en la casa, rodeado de jardines y patios cuidados al más mínimo detalle, por donde se puede acceder a la zona de la piscina, junto a la cual encontramos una cocina exterior con barbacoa, y una \"casa Spa\" con sauna, baños turcos, duchas y salón de masajes. \r\n \r\n Al lado de la casa principal se encuentra la casa de invitados de unos 50m² con entrada independiente, salón-comedor, cocina americana, una habitación doble, cuarto de baño completo y terraza.\r\n Detrás de la casa también hay una caseta actualmente utilizada como oficina, que  puede ser utilizada como casa de invitados adicional.\r\n \r\n La casa y casetas de esta finca cuentan con calefacción central por gasoil, suelo radiante, instalación de aire acondicionado (frío/calor) y ventanas climalit. Además, la electricidad está conectada a la red eléctrica, y complementada por un sistema de placas solares tanto para la electricidad como para el agua caliente. \r\n \r\n La parcela tiene unos 12.700m², donde también encontramos un picadero de 20 x 40 metros, establo, zona de árboles frutales y pozo de agua propio con sistema de tratamiento de agua por osmosis. Finca totalmente vallada y controlada.', 4, 0, 3, 220, 1390000),
(153948548, 724, 7, 7040, 1021, 7013, 39.58626, 2.607692, '2021-11-17', 'Elegancia, diseño y calidad de vida en un entorno privilegiado son algunos de los aspectos que te puede ofrecer este espectacular ático de nueva construcción en complejo residencial de alto standing situado en una zona residencial con vistas a los exclusivos campos de golf de Son Vida y Son Quint y de ambiente familiar. Muy bien comunicado con la vía de cintura y transporte público.\n Este fabuloso ático de 177m2 y unas terrazas de aprox.40 m2 donde también podrá disfrutar y relajarse en su azotea de 223m2 con preinstalación de barbacoa y piscina privada acompañado de unas espectaculares vistas a la montaña y campos de golf, la vivienda distribuida en 4 dormitorios dobles, 3 baños, 2 con baño en suite, un aseo y una amplia y moderna cocina totalmente equipada con electrodomésticos de la marca Siemens \n Dispone también de una exclusiva zona común con jardines mediterráneos, con senderos iluminados, piscina exterior para adultos y gimnasio propio, el propietario podrá disfrutar además de la exclusiva zona de spa [amp;] wellness. Otras características: Suelos de mármol, calefacción de suelo radiante, ventanas de doble cristal, chimenea de gas, videoportero, jacuzzi, bañera de hidromasaje, Garaje para 3 coches y trastero.\n Son Vida un lugar realmente envidiable para vivir o pasar sus vacaciones. El centro de la ciudad de Palma está a menos de 10 minutos en coche y el aeropuerto internacional a menos de 20 minutos. \n Para obtener más información sobre este espectacular ático en Mallorca, no dude en ponerse en contacto con uno de nuestros agentes inmobiliarios, ¡le atenderemos encantados!\n \n Impuestos no incluidos.', 4, 8, 4, 454, 1500000),
(154029498, 724, 7, 7040, 1024, 7199, 39.58562, 2.773852, '2021-10-25', 'Gran casa con carácter para reformar de dos plantas, cuenta además con un estanque y un molino. Situado a 8 km de Palma y con vistas despejadas.', 0, 0, 0, 23755, 435000),
(154195019, 724, 7, 7040, 1022, 7610, 39.52238, 2.745812, '2021-11-11', 'PALMA- ZONA LAS MARAVILLAS- CALLE SANT RAMÓN NONAT. Si buscas una casa amplia, con terrazas y jardín cerca de Playa de Palma y que además de vivir disponga de otro espacio amplio para tus hobbies, Como almacén o lugar de trabajo esta puede ser tu casa perfecta.\n Sobre parcela de casi 500 m2 se ubica una construcción de 400 m2 en 2 plantas, quedando disponibles un gran espacio para jardines privados. \n La PLANTA BAJA: donde se ubica el local se compone de una gran sala casi diáfana de 120 m2, cocina (antiguamente un restaurante) y otros 60 m2, con 2 aseos y varias salas adicionales.\n La PLANTA ALTA: destinada a vivienda consta de un amplio salón-comedor con chimenea y acceso a una gran terraza en planta de 80 m2, cocina con office, 4 dormitorios y 2 baños completos.\n La planta alta dispone de acceso independiente y también se comunica mediante una escalera interior.\n Playa a sólo 400 metros.\n Precio: 395.000 Euros.', 4, 0, 5, 400, 395000),
(154217556, 724, 7, 7065, 0, 7250, 39.56543, 3.087545, '2021-11-17', 'INMUEBLE EN RENTABILIDAD. Se vende Piso de 96,3 m2 construidos en edificio moderno ubicado en Vilafranca del Bonany, Mallorca. El inmueble consta de 3 dormitorios y 2 baños. Finca con ascensor. Plaza de garaje y trastero incluido. Zona dotada con todos los servicios y próximo a polideportivo municipal. Llame ahora para conocer más información sobre el inmueble y concertar una visita. - No cobramos comisión al comprador.- &#x20  - LA PROPIEDAD NO GARANTIZA LA DISPONIBILIDAD DE ACCESO A LA FINCA, PUDIENDO ESTAR OCUPADA POR TERCERO SIN TITULO', 2, 0, 3, 96, 123900),
(154217584, 724, 7, 7065, 0, 7250, 39.56535, 3.086887, '2021-11-17', 'INMUEBLE EN RENTABILIDAD. Se vende bonito Piso duplex en edificio moderno ubicado en Vilafranca del Bonany, Mallorca. Tiene una superficie  de 101,64 m2 construidos. Finca con ascensor. El inmueble consta de 3 dormitorios y 2 baños. Garaje y Trastero  incluidos en el precio. Zona dotada con todos los servicios y próximo a polideportivo municipal. Llame ahora paraconocer más información sobre el inmueble y concertar una visita. - No cobramos comisión al comprador.- &#x20  - LA PROPIEDAD NO GARANTIZA LA DISPONIBILIDAD DE ACCESO A LA FINCA, PUDIENDO ESTAR OCUPADA POR TERCERO SIN TITULO', 2, 0, 3, 101, 128400);
